description:
City Of Vices
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

It's just another day in the City Of Vices when Cynthia and Val are tasked to deliver a package to mobster, Antonio. Trouble occurs when the place is raided by the Vice Squad and their package is stolen by corrupt cop, Drake. Not wanting to get killed, the girls hand Antonio a pseudo package. Things go from bad to worse when Cynthia shoots Antonio using Drake's gun! Now Drake must help Cynthia clean the mess before the crew finds out the package is fake! All events transpire into an all-out war between Antonio's gang and Lord Vasquez, while Cynthia and Drake just try to stay alive.

Cast: Aletta Ocean   Anissa Kate   Jasmine Jae   Lou Lou   Lexi Lowe   Ian Scott   Ryan Ryder   Michael Angelo 

